    const [data,setData]=useState([]);
  const getData=()=>{
    fetch(Products)
      .then(function(response){
        console.log(response)
        return response.json();
      })
      .then(function(myJson) {
        console.log(myJson);
        setData(myJson)
      });
  }
  useEffect(()=>{
    getData()
  },[])
    return (
       <div>
        {data}
        <p>The server is running at port 5000 and is fetching</p>
       </div>
    )
}
